function start_oid_lookup(){var D=document.getElementById("oid_lookup");var C=D.value;if(!C){return }var A="/zport/showOID2XML?oid="+C;var B=getXMLHttpRequest();B.open("GET",A,true);sendXMLHttpRequest(B).addCallback(process_XML_OID_lookup_response)}process_XML_OID_lookup_response=function(C){var B=C.responseXML;var A=B.getElementsByTagName("stdout")[0];if(A){document.getElementById("oid_result").value=unescape(A.textContent)}else{alert("\nUnable to parse out 'stdout' element from server response\nTruncated XML response=\n"+C.responseText)}};